import React,{useState,Component} from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,KeyboardAvoidingView,Picker,TextInput} from 'react-native';
import {css} from '../assets/Css/css';
import DatePicker from 'react-native-datepicker';


export default class Teste1 extends Component (props1) {
    state = {data:''}
    changeDate = (valor) => this.setState({data:valor}) 
    render() {
        return (
            <SafeAreaView style = {css.fundo}>
                <View style = {css.login_form}>
                    <DatePicker selected ={selectedDate} style={{ height: 50, width: 150 }} onDateChange = {this.changeDate} value = {selectedDate} id = 'data' dateFormat = "dd/MM/yyyy" placeholderText =  'Data de Referência' />
                </View>
                <View>
                    <TouchableOpacity title = "Predição" onPress={()=>props1.navigation.navigate('Preditor2')} style = {css.login_button}><Text style = {css.login_buttonText}>Preditor2</Text> </TouchableOpacity>
                </View>
            </SafeAreaView>
        );
    }
    
}
